{
        let label = UILabel()

        label.numberOfLines = 0
        label.font = .boldSystemFont(ofSize: CGFloat(NumberConstants.settingContentLabelSize))
        label.textColor = .black
        label.text = StringConstants.setAntiCaptureViewTitle

        return label
    }()

{
        let segmentControl = UISegmentedControl()

        segmentControl.insertSegment(withTitle: "Enable", at: 0, animated: true)
        segmentControl.insertSegment(withTitle: "Disable", at: 1, animated: true)

